INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 60000, 0, "カリン", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 190804, "", 0, 1, 0, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60000, 0, "", "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 1, 0, "", 1, 2, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60000, 0, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, 0, "", 1, 3, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60000, 0, "", "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 2, 0, "", 1, 4, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60000, 0, "", "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 1, 0, "", 2, 5, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60000, 0, "", "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 1, 0, "", 2, 6, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60000, 0, "", "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, 0, "", 2, 7, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60000, 0, "", "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 1, 0, "", 3, 8, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60000, 0, "", "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 1, 0, "", 3, 9, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60000, 0, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 1, 0, "", 3, 10, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60000, 0, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 1, 0, "", 3, 11, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60000, 0, "", "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 2, 0, "", 3, 12, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60000, 0, "", "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 1, 0, "", 4, 13, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60000, 0, "", "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 1, 0, "", 4, 14, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60000, 0, "", "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 1, 0, "", 4, 15, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60000, 0, "", "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 1, 0, "", 4, 16, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60000, 0, "", "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, 0, "", 4, 17, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 60000, 0, "カリン", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 190804, "", 0, 18, 0, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, 60000, 0, "カリン", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, 190804, "", 0, 19, 7, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "ハツネ", "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 0, 101201, "", 0, 20, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "ハツネ", "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 0, 101201, "", 0, 21, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "シオリ", "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 0, 103801, "", 0, 22, 1, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "シオリ", "来年も、\n一緒にいられたら…\nうれしいな", 0, 103801, "", 0, 23, 1, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "キョウカ", "あなたと一緒にいるようになって、\nもう1年ですか…", 0, 103601, "", 0, 24, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "キョウカ", "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 0, 103601, "", 0, 25, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "ミミ", "おにいちゃんとあってから、\n1年たったよ～！", 0, 102001, "", 0, 26, 2, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "ミミ", "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 0, 102001, "", 0, 27, 2, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "ミソギ", "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 0, 100401, "", 0, 28, 2, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "ミソギ", "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 0, 100401, "", 0, 29, 2, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "マホ", "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 0, 101001, "", 0, 30, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "マホ", "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 0, 101001, "", 0, 31, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "イリヤ", "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 0, 104401, "", 0, 32, 3, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "イリヤ", "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 0, 104401, "", 0, 33, 3, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "カオリ", "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 0, 101701, "", 0, 34, 3, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "カオリ", "これからも、どうぞよろしく\nお願いするさ～！", 0, 101701, "", 0, 35, 3, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "サレン", "あんたと出会ってからもうそんなに\nたつのね～", 0, 102801, "", 0, 36, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "サレン", "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 0, 102801, "", 0, 37, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "スズメ", "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 0, 102501, "", 0, 38, 4, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "スズメ", "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 0, 102501, "", 0, 39, 4, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "タマキ", "振り返れば、今までいろんなことが\nあったにゃあ…", 0, 104601, "", 0, 40, 5, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "タマキ", "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 0, 104601, "", 0, 41, 5, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "ミフユ", "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 0, 104801, "", 0, 42, 5, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "ミフユ", "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 0, 104801, "", 0, 43, 5, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "アキノ", "あなたさまと出会ってもう1年…", 0, 103201, "", 0, 44, 6, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "アキノ", "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 0, 103201, "", 0, 45, 6, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "ユカリ", "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 0, 103401, "", 0, 46, 6, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "ユカリ", "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 0, 103401, "", 0, 47, 6, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "クリスティーナ", "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 0, 107101, "", 0, 48, 7, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "クリスティーナ", "ともかくこれからも\n愉しませてくれよ☆", 0, 107101, "", 0, 49, 7, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "ジュン", "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 0, 104701, "", 0, 50, 7, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "ジュン", "見えないから分からないって？\nそれもそうだな…", 0, 104701, "", 0, 51, 7, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "トモ", "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 0, 103701, "", 0, 52, 8, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "トモ", "これからもよろしくね！", 0, 103701, "", 0, 53, 8, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "マツリ", "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 0, 100501, "", 0, 54, 8, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "マツリ", "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 0, 100501, "", 0, 55, 8, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "ミヤコ", "オマエと会って1年なの！\n全然成仏もできなかったし、", 0, 100701, "", 0, 56, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "ミヤコ", "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 0, 100701, "", 0, 57, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "シノブ", "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 0, 103101, "", 0, 58, 9, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "シノブ", "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 0, 103101, "", 0, 59, 9, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "アンナ", "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 0, 100901, "", 0, 60, 10, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "アンナ", "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 0, 100901, "", 0, 61, 10, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "ナナカ", "君と出会ってもう1年だって！\n早いねー！", 0, 101301, "", 0, 62, 10, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "ナナカ", "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 0, 101301, "", 0, 63, 10, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "ミツキ", "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 0, 105101, "", 0, 64, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "ミツキ", "これからも、いろんなところを\n調べさせてね？", 0, 105101, "", 0, 65, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "ルカ", "お前さんと出会ってもう1年か\n助太刀するつもりが", 0, 105601, "", 0, 66, 11, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "ルカ", "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 0, 105601, "", 0, 67, 11, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "エリコ", "早いものですわね、あなた様と\nお会いして、もう1年…", 0, 102701, "", 0, 68, 11, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "エリコ", "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 0, 102701, "", 0, 69, 11, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "アヤネ", "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 0, 102301, "", 0, 70, 12, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "アヤネ", "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 0, 102301, "", 0, 71, 12, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "チカ", "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 0, 104201, "", 0, 72, 12, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "チカ", "私のことを見守ってください\nできることなら、ずっと…", 0, 104201, "", 0, 73, 12, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "クルミ", "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 0, 102101, "", 0, 74, 12, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "クルミ", "で、でもこれからもずっと…\n一緒にいたいなぁ…", 0, 102101, "", 0, 75, 12, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "シズル", "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 0, 104901, "", 0, 76, 13, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "シズル", "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 0, 104901, "", 0, 77, 13, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "リノ", "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 0, 101101, "", 0, 78, 13, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "リノ", "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 0, 101101, "", 0, 79, 13, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "ユイ", "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 0, 100201, "", 0, 80, 14, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "ユイ", "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 0, 100201, "", 0, 81, 14, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "ヒヨリ", "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 0, 100101, "", 0, 82, 14, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "ヒヨリ", "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 0, 100101, "", 0, 83, 14, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "レイ", "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 0, 100301, "", 0, 84, 14, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "レイ", "キミに背中を預けられる日が、\n早くきますように", 0, 100301, "", 0, 85, 14, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "ペコリーヌ", "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 0, 105801, "", 0, 86, 15, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "ペコリーヌ", "これからもずっと、覚えていて\nくださいね！", 0, 105801, "", 0, 87, 15, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "コッコロ", "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 0, 105901, "", 0, 88, 15, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "コッコロ", "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 0, 105901, "", 0, 89, 15, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80001, 0, "キャル", "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 0, 106001, "", 0, 90, 15, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80001, 0, "キャル", "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 0, 106001, "", 0, 91, 15, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 60001, 0, "スズメ", "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 1, 112101, "", 0, 92, 0, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 1, 0, "", 1, 93, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, 0, "", 1, 94, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 1, 0, "", 1, 95, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 1, 0, "", 1, 96, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 2, 0, "", 1, 97, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 1, 0, "", 2, 98, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 1, 0, "", 2, 99, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 1, 0, "", 2, 100, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 1, 0, "", 2, 101, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, 0, "", 2, 102, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 1, 0, "", 3, 103, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 1, 0, "", 3, 104, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 1, 0, "", 3, 105, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 1, 0, "", 3, 106, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 1, 0, "", 3, 107, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 1, 0, "", 3, 108, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 2, 0, "", 3, 109, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 1, 0, "", 4, 110, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 1, 0, "", 4, 111, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 1, 0, "", 4, 112, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 1, 0, "", 4, 113, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 1, 0, "", 4, 114, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 1, 0, "", 4, 115, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60001, 0, "", "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, 0, "", 4, 116, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 60001, 0, "スズメ", "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 0, 112101, "", 0, 117, 0, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, 60001, 0, "スズメ", "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 0, 112101, "", 0, 118, 7, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80003, 0, "ペコリーヌ", "ヒューヒュー♪\nドンドンパフパフー♪", 0, 105801, "", 0, 119, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80003, 0, "コッコロ", "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 0, 105901, "", 0, 120, 1, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80003, 0, "コッコロ", "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 0, 105901, "", 0, 121, 1, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80003, 0, "キャル", "え？　ちょっと\nいきなりなにっ？", 0, 106001, "", 0, 122, 1, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80003, 0, "キャル", "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 0, 106001, "", 0, 123, 1, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80003, 0, "ペコリーヌ", "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 0, 105801, "", 0, 124, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, 80003, 0, "ペコリーヌ", "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 0, 105801, "", 0, 125, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, 80003, 0, "コッコロ", "ですからその日に向けて\n今から気分を盛り上げているのです", 0, 105901, "", 0, 126, 1, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, 80003, 0, "キャル", "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 0, 106001, "", 0, 127, 1, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, 80003, 0, "コッコロ", "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 0, 105901, "", 0, 128, 1, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, 80003, 0, "ペコリーヌ", "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 0, 105801, "", 0, 129, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, 80003, 0, "キャル", "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 0, 106001, "", 0, 130, 1, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, 80003, 0, "コッコロ", "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 0, 105901, "", 0, 131, 1, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, 80003, 0, "キャル", "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 0, 106001, "", 0, 132, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80003, 0, "カリン", "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 0, 190801, "", 0, 133, 2, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, 80003, 0, "キャル", "げっ…カリンじゃない\nなんでもないわよ！", 0, 106001, "", 0, 134, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80003, 0, "カリン", "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 0, 190801, "", 0, 135, 2, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, 80003, 0, "キャル", "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 0, 106001, "", 0, 136, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, 80003, 0, "カリン", "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 0, 190801, "", 0, 137, 2, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, 80003, 0, "キャル", "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 0, 106001, "", 0, 138, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, 80003, 0, "キャル", "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 0, 106001, "", 0, 139, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, 80003, 0, "カリン", "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 0, 190801, "", 0, 140, 2, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, 80003, 0, "キャル", "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 0, 106001, "", 0, 141, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, 80003, 0, "カリン", "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 0, 190801, "", 0, 142, 2, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, 80003, 0, "キャル", "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 0, 106001, "", 0, 143, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, 80003, 0, "コッコロ", "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 0, 105901, "", 0, 144, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, 80003, 0, "ペコリーヌ", "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 0, 105801, "", 0, 145, 3, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, 80003, 0, "コッコロ", "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 0, 105901, "", 0, 146, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, 80003, 0, "コッコロ", "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 0, 105901, "", 0, 147, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, 80003, 0, "ペコリーヌ", "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 0, 105801, "", 0, 148, 3, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, 80003, 0, "ペコリーヌ", "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 0, 105801, "", 0, 149, 3, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, 80003, 0, "コッコロ", "あとは、牧場に素敵な温泉が\n出来たとか…", 0, 105901, "", 0, 150, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, 80003, 0, "ペコリーヌ", "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 0, 105801, "", 0, 151, 3, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, 80003, 0, "コッコロ", "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 0, 105901, "", 0, 152, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, 80003, 0, "ペコリーヌ", "えへへ、ありがとうございます\nコッコロちゃん！", 0, 105801, "", 0, 153, 3, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, 80003, 0, "コッコロ", "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 0, 105901, "", 0, 154, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, 80003, 0, "ペコリーヌ", "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 0, 105801, "", 0, 155, 3, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, 80003, 0, "ペコリーヌ", "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 0, 105801, "", 0, 156, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, 80003, 0, "キャル", "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 0, 106001, "", 0, 157, 4, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, 80003, 0, "ペコリーヌ", "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 0, 105801, "", 0, 158, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, 80003, 0, "キャル", "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 0, 106001, "", 0, 159, 4, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, 80003, 0, "ペコリーヌ", "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 0, 105801, "", 0, 160, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, 80003, 0, "キャル", "…積極的？\nなんの話よ？", 0, 106001, "", 0, 161, 4, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, 80003, 0, "ペコリーヌ", "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 0, 105801, "", 0, 162, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, 80003, 0, "ペコリーヌ", "ムーサの町で\nきゃるきゃる～ん☆　って！", 0, 105801, "", 0, 163, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, 80003, 0, "キャル", "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 0, 106001, "", 0, 164, 4, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (16, 80003, 0, "ペコリーヌ", "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 0, 105801, "", 0, 165, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (16, 80003, 0, "キャル", "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 0, 106001, "", 0, 166, 4, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (17, 80003, 0, "キャル", "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 0, 106001, "", 0, 167, 4, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (18, 80003, 0, "キャル", "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 0, 106001, "", 0, 168, 5, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, 80003, 0, "コッコロ", "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 0, 105901, "", 0, 169, 5, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (19, 80003, 0, "キャル", "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 0, 106001, "", 0, 170, 5, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, 80003, 0, "コッコロ", "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 0, 105901, "", 0, 171, 5, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (20, 80003, 0, "キャル", "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 0, 106001, "", 0, 172, 5, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, 80003, 0, "コッコロ", "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 0, 105901, "", 0, 173, 5, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (21, 80003, 0, "キャル", "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 0, 106001, "", 0, 174, 5, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, 80003, 0, "コッコロ", "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 0, 105901, "", 0, 175, 5, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (22, 80003, 0, "キャル", "かくし芸？", 0, 106001, "", 0, 176, 5, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (16, 80003, 0, "コッコロ", "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 0, 105901, "", 0, 177, 5, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (23, 80003, 0, "キャル", "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 0, 106001, "", 0, 178, 5, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (17, 80003, 0, "ペコリーヌ", "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 0, 105801, "", 0, 179, 6, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (24, 80003, 0, "キャル", "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 0, 106001, "", 0, 180, 6, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (17, 80003, 0, "コッコロ", "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 0, 105901, "", 0, 181, 6, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (18, 80003, 0, "ペコリーヌ", "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 0, 105801, "", 0, 182, 6, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (25, 80003, 0, "キャル", "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 0, 106001, "", 0, 183, 6, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (18, 80003, 0, "コッコロ", "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 0, 105901, "", 0, 184, 6, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (26, 80003, 0, "キャル", "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 0, 106001, "", 0, 185, 6, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (27, 80003, 0, "キャル", "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 0, 106001, "", 0, 186, 6, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (28, 80003, 0, "キャル", "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 0, 106001, "", 0, 187, 6, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (19, 80003, 0, "ペコリーヌ", "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 0, 105801, "", 0, 188, 6, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (19, 80003, 0, "コッコロ", "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 0, 105901, "", 0, 189, 6, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (29, 80003, 0, "キャル", "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 0, 106001, "", 0, 190, 6, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (30, 80003, 0, "キャル", "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 0, 106001, "", 0, 191, 7, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (31, 80003, 0, "キャル", "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 0, 106001, "", 0, 192, 7, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (32, 80003, 0, "キャル", "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 0, 106001, "", 0, 193, 7, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (33, 80003, 0, "キャル", "あー\nあー\n…声、これで大丈夫かしら？", 0, 106001, "", 0, 194, 7, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (34, 80003, 0, "キャル", "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 0, 106001, "", 0, 195, 7, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (35, 80003, 0, "キャル", "オイッスー☆", 0, 106001, "", 0, 196, 7, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (36, 80003, 0, "キャル", "……\nいや、ないわ\nいつもどおりが一番ね、うん", 0, 106001, "", 0, 197, 7, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (37, 80003, 0, "キャル", "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 0, 106001, "", 0, 198, 7, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (38, 80003, 0, "キャル", "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 0, 106001, "", 0, 199, 7, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (20, 80003, 0, "コッコロ", "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 0, 105901, "", 0, 200, 8, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (21, 80003, 0, "コッコロ", "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 0, 105901, "", 0, 201, 8, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (22, 80003, 0, "コッコロ", "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 0, 105901, "", 0, 202, 8, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (23, 80003, 0, "コッコロ", "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 0, 105901, "", 0, 203, 8, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (24, 80003, 0, "コッコロ", "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 0, 105901, "", 0, 204, 8, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (25, 80003, 0, "コッコロ", "オイッスー☆", 0, 105901, "", 0, 205, 8, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (26, 80003, 0, "コッコロ", "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 0, 105901, "", 0, 206, 8, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (27, 80003, 0, "コッコロ", "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 0, 105901, "", 0, 207, 8, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (28, 80003, 0, "コッコロ", "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 0, 105901, "", 0, 208, 8, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (20, 80003, 0, "ペコリーヌ", "オイッスー☆", 0, 105801, "", 0, 209, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (21, 80003, 0, "ペコリーヌ", "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 0, 105801, "", 0, 210, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (22, 80003, 0, "ペコリーヌ", "あと６日で2.5周年ですか…", 0, 105801, "", 0, 211, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (23, 80003, 0, "ペコリーヌ", "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 0, 105801, "", 0, 212, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (24, 80003, 0, "ペコリーヌ", "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 0, 105801, "", 0, 213, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (25, 80003, 0, "ペコリーヌ", "オイッスー☆", 0, 105801, "", 0, 214, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (26, 80003, 0, "ペコリーヌ", "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 0, 105801, "", 0, 215, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (27, 80003, 0, "ペコリーヌ", "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 0, 105801, "", 0, 216, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (28, 80003, 0, "ペコリーヌ", "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 0, 105801, "", 0, 217, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (29, 80003, 0, "ペコリーヌ", "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 0, 105801, "", 0, 218, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (30, 80003, 0, "ペコリーヌ", "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 0, 105801, "", 0, 219, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (31, 80003, 0, "ペコリーヌ", "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 0, 105801, "", 0, 220, 10, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (29, 80003, 0, "コッコロ", "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 0, 105901, "", 0, 221, 10, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (32, 80003, 0, "ペコリーヌ", "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 0, 105801, "", 0, 222, 10, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (39, 80003, 0, "キャル", "…………", 0, 106001, "", 0, 223, 10, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (30, 80003, 0, "コッコロ", "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 0, 105901, "", 0, 224, 10, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (40, 80003, 0, "キャル", "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 0, 106001, "", 0, 225, 10, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (33, 80003, 0, "ペコリーヌ", "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 0, 105801, "", 0, 226, 10, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (41, 80003, 0, "キャル", "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 0, 106001, "", 0, 227, 10, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (34, 80003, 0, "ペコリーヌ", "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 0, 105801, "", 0, 228, 10, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (35, 80003, 0, "ペコリーヌ", "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 0, 105801, "", 0, 229, 10, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (42, 80003, 0, "キャル", "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 0, 106001, "", 0, 230, 10, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (31, 80003, 0, "コッコロ", "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 0, 105901, "", 0, 231, 10, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (43, 80003, 0, "キャル", "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 0, 106001, "", 0, 232, 10, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (36, 80003, 0, "ペコリーヌ", "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 0, 105801, "", 0, 233, 10, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, 80003, 0, "カリン", "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 0, 190801, "", 0, 234, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, 80003, 0, "カリン", "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 0, 190801, "", 0, 235, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, 80003, 0, "カリン", "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 0, 190801, "", 0, 236, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, 80003, 0, "カリン", "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 0, 190801, "", 0, 237, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, 80003, 0, "カリン", "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 0, 190801, "", 0, 238, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, 80003, 0, "カリン", "次にコッコロさんですが\nこちらは発声練習をしています", 0, 190801, "", 0, 239, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, 80003, 0, "カリン", "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 0, 190801, "", 0, 240, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, 80003, 0, "カリン", "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 0, 190801, "", 0, 241, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, 80003, 0, "カリン", "あれ？\nもしかして緊張で気を失って…？", 0, 190801, "", 0, 242, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, 80003, 0, "カリン", "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 0, 190801, "", 0, 243, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (16, 80003, 0, "カリン", "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 0, 190801, "", 0, 244, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (17, 80003, 0, "カリン", "それでは\nまた明日お会いしましょう♪", 0, 190801, "", 0, 245, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (44, 80003, 0, "キャル", "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 0, 106001, "", 0, 246, 12, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (37, 80003, 0, "ペコリーヌ", "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 0, 105801, "", 0, 247, 12, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (32, 80003, 0, "コッコロ", "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 0, 105901, "", 0, 248, 12, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (45, 80003, 0, "キャル", "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 0, 106001, "", 0, 249, 12, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (38, 80003, 0, "ペコリーヌ", "ひどいですよぉキャルちゃ～ん！", 0, 105801, "", 0, 250, 12, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (33, 80003, 0, "コッコロ", "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 0, 105901, "", 0, 251, 12, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (39, 80003, 0, "ペコリーヌ", "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 0, 105801, "", 0, 252, 12, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (46, 80003, 0, "キャル", "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 0, 106001, "", 0, 253, 12, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (34, 80003, 0, "コッコロ", "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 0, 105901, "", 0, 254, 12, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (40, 80003, 0, "ペコリーヌ", "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 0, 105801, "", 0, 255, 12, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (41, 80003, 0, "ペコリーヌ", "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 0, 105801, "", 0, 256, 13, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (47, 80003, 0, "キャル", "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 0, 106001, "", 0, 257, 13, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (42, 80003, 0, "ペコリーヌ", "忘れてきちゃいました☆", 0, 105801, "", 0, 258, 13, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (48, 80003, 0, "キャル", "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 0, 106001, "", 0, 259, 13, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (35, 80003, 0, "コッコロ", "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 0, 105901, "", 0, 260, 13, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (49, 80003, 0, "キャル", "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 0, 106001, "", 0, 261, 13, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (43, 80003, 0, "ペコリーヌ", "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 0, 105801, "", 0, 262, 13, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (50, 80003, 0, "キャル", "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 0, 106001, "", 0, 263, 13, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (36, 80003, 0, "コッコロ", "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 0, 105901, "", 0, 264, 13, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (51, 80003, 0, "キャル", "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 0, 106001, "", 0, 265, 13, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (37, 80003, 0, "コッコロ", "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 0, 105901, "", 0, 266, 13, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (52, 80003, 0, "キャル", "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 0, 106001, "", 0, 267, 13, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (44, 80003, 0, "ペコリーヌ", "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 0, 105801, "", 0, 268, 13, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (38, 80003, 0, "コッコロ", "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 0, 105901, "", 0, 269, 13, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (45, 80003, 0, "ペコリーヌ", "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 0, 105801, "", 0, 270, 13, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (53, 80003, 0, "キャル", "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 0, 106001, "", 0, 271, 13, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (46, 80003, 0, "ペコリーヌ", "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 0, 105801, "", 0, 272, 13, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (18, 80003, 0, "カリン", "こんにちは\n【ギルド管理協会】のカリンです", 0, 190801, "", 0, 273, 14, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (19, 80003, 0, "カリン", "昨日の生放送は\nいかがだったでしょうか？", 0, 190801, "", 0, 274, 14, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (20, 80003, 0, "カリン", "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 0, 190801, "", 0, 275, 14, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (21, 80003, 0, "カリン", "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 0, 190801, "", 0, 276, 14, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (22, 80003, 0, "カリン", "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 0, 190801, "", 0, 277, 14, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (23, 80003, 0, "カリン", "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 0, 190801, "", 0, 278, 14, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (24, 80003, 0, "カリン", "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 0, 190801, "", 0, 279, 14, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (25, 80003, 0, "カリン", "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 0, 190801, "", 0, 280, 14, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (26, 80003, 0, "カリン", "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 0, 190801, "", 0, 281, 14, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (27, 80003, 0, "カリン", "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 0, 190801, "", 0, 282, 14, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (47, 80003, 0, "ペコリーヌ", "準備はいいですかっ？\n…いっきますよー！", 0, 105801, "", 0, 283, 15, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (54, 80003, 0, "キャル", "祝！", 0, 106001, "", 0, 284, 15, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (39, 80003, 0, "コッコロ", "2.5周年！", 0, 105901, "", 0, 285, 15, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (48, 80003, 0, "ペコリーヌ", "おめでとうございま～す☆", 0, 105801, "", 0, 286, 15, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (55, 80003, 0, "キャル", "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 0, 106001, "", 0, 287, 15, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (40, 80003, 0, "コッコロ", "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 0, 105901, "", 0, 288, 15, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (49, 80003, 0, "ペコリーヌ", "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 0, 105801, "", 0, 289, 15, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (56, 80003, 0, "キャル", "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 0, 106001, "", 0, 290, 15, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (41, 80003, 0, "コッコロ", "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 0, 105901, "", 0, 291, 15, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (57, 80003, 0, "キャル", "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 0, 106001, "", 0, 292, 15, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (50, 80003, 0, "ペコリーヌ", "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 0, 105801, "", 0, 293, 15, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (58, 80003, 0, "キャル", "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 0, 106001, "", 0, 294, 15, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (51, 80003, 0, "ペコリーヌ", "記念日だから\n平気平気♪\nやばいですね☆", 0, 105801, "", 0, 295, 15, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (59, 80003, 0, "キャル", "意味分かんないわよ！", 0, 106001, "", 0, 296, 15, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (42, 80003, 0, "コッコロ", "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 0, 105901, "", 0, 297, 15, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (43, 80003, 0, "コッコロ", "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 0, 105901, "", 0, 298, 15, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (52, 80003, 0, "ペコリーヌ", "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 0, 105801, "", 0, 299, 15, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (60, 80003, 0, "キャル", "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 0, 106001, "", 0, 300, 15, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (44, 80003, 0, "コッコロ", "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 0, 105901, "", 0, 301, 15, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (53, 80003, 0, "ペコリーヌ", "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 0, 105801, "", 0, 302, 15, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (54, 80003, 1, "ペコリーヌ・コッコロ・キャル", "2.5周年\nありがとうございます！", 0, 105801, "105901,45,106001,61", 0, 303, 15, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 60002, 0, "カリン", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 190804, "", 0, 304, 0, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 1, 0, "", 1, 305, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, 0, "", 1, 306, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 1, 0, "", 1, 307, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 1, 0, "", 1, 308, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2, 0, "", 1, 309, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 1, 0, "", 2, 310, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 1, 0, "", 2, 311, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 1, 0, "", 2, 312, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 1, 0, "", 2, 313, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, 0, "", 2, 314, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 1, 0, "", 3, 315, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 1, 0, "", 3, 316, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 1, 0, "", 3, 317, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 1, 0, "", 3, 318, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 1, 0, "", 3, 319, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 1, 0, "", 3, 320, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 2, 0, "", 3, 321, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 1, 0, "", 4, 322, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 1, 0, "", 4, 323, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 1, 0, "", 4, 324, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 1, 0, "", 4, 325, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 1, 0, "", 4, 326, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 1, 0, "", 4, 327, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60002, 0, "", "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, 0, "", 4, 328, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 60002, 0, "カリン", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 190804, "", 0, 329, 0, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, 60002, 0, "カリン", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, 190804, "", 0, 330, 7, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80005, 0, "コッコロ", "ささ、シェフィさまはこちらへ…", 0, 105901, "", 0, 331, 1, 4);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80005, 0, "シェフィ", "コッコロさん、どこへ行くの…？\n…え？", 0, 106401, "", 0, 332, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80005, 0, "ペコリーヌ", "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 0, 105801, "", 0, 333, 1, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80005, 0, "コッコロ", "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 0, 105901, "", 0, 334, 1, 4);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80005, 0, "シェフィ", "ええと…\n二人とも何をしているの？", 0, 106401, "", 0, 335, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80005, 0, "キャル", "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 0, 106001, "", 0, 336, 1, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, 80005, 0, "シェフィ", "あの日…？", 0, 106401, "", 0, 337, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80005, 0, "ペコリーヌ", "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 0, 105801, "", 0, 338, 1, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, 80005, 0, "ペコリーヌ", "『プリンセスコネクト！\nRe:Dive』3.5周年！", 0, 105801, "", 0, 339, 1, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 80005, 0, "カリン", "やばいですね☆", 0, 190801, "", 0, 340, 1, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80005, 0, "キャル", "って、なにしれっと\n参加してんのよカリン！", 0, 106001, "", 0, 341, 1, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 80005, 0, "カリン", "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 0, 190801, "", 0, 342, 1, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, 80005, 0, "カリン", "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 0, 190801, "", 0, 343, 1, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, 80005, 0, "ペコリーヌ", "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 0, 105801, "", 0, 344, 1, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, 80005, 0, "シェフィ", "えっ！？　ええとええと…！\nあ、あと14日…！", 0, 106401, "", 0, 345, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, 80005, 0, "ペコリーヌ", "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 0, 105801, "", 0, 346, 2, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, 80005, 0, "コッコロ", "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 0, 105901, "", 0, 347, 2, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, 80005, 0, "コッコロ", "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 0, 105901, "", 0, 348, 2, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, 80005, 0, "ペコリーヌ", "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 0, 105801, "", 0, 349, 2, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, 80005, 0, "コッコロ", "さすがでございます\nペコリーヌさま", 0, 105901, "", 0, 350, 2, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, 80005, 0, "キャル", "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 0, 106001, "", 0, 351, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, 80005, 0, "シェフィ", "しゃなり、しゃなり…\nふふ、案外できるものね", 0, 106401, "", 0, 352, 2, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, 80005, 0, "ペコリーヌ", "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 0, 105801, "", 0, 353, 2, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, 80005, 0, "コッコロ", "さ、次はキャルさまの\n番でございますよ", 0, 105901, "", 0, 354, 2, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, 80005, 0, "キャル", "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 0, 106001, "", 0, 355, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, 80005, 0, "シェフィ", "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 0, 106401, "", 0, 356, 2, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, 80005, 0, "キャル", "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 0, 106001, "", 0, 357, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, 80005, 0, "キャル", "いたたた…もぉお～！\nなんであたしがこんな目に～！", 0, 106001, "", 0, 358, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, 80005, 0, "コッコロ", "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 0, 105901, "", 0, 359, 2, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, 80005, 0, "キャル", "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 0, 106001, "", 0, 360, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, 80005, 0, "コッコロ", "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 0, 105901, "", 0, 361, 3, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, 80005, 0, "ペコリーヌ", "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 0, 105801, "", 0, 362, 3, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, 80005, 0, "コッコロ", "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 0, 105901, "", 0, 363, 3, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, 80005, 0, "シェフィ", "聖学祭…って、なにかしら？", 0, 106401, "", 0, 364, 3, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, 80005, 0, "コッコロ", "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 0, 105901, "", 0, 365, 3, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, 80005, 0, "キャル", "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 0, 106001, "", 0, 366, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, 80005, 0, "キャル", "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 0, 106001, "", 0, 367, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, 80005, 0, "ペコリーヌ", "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 0, 105801, "", 0, 368, 3, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, 80005, 0, "キャル", "いや、そのまんますぎでしょ…", 0, 106001, "", 0, 369, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, 80005, 0, "シェフィ", "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 0, 106401, "", 0, 370, 3, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, 80005, 0, "ペコリーヌ", "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 0, 105801, "", 0, 371, 3, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, 80005, 0, "シェフィ", "えっ？　ええ…\nぎゅーっ…？", 0, 106401, "", 0, 372, 3, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, 80005, 0, "キャル", "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 0, 106001, "", 0, 373, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, 80005, 0, "シェフィ", "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 0, 106401, "", 0, 374, 4, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, 80005, 0, "キャル", "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 0, 106001, "", 0, 375, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, 80005, 0, "コッコロ", "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 0, 105901, "", 0, 376, 4, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, 80005, 0, "キャル", "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 0, 106001, "", 0, 377, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, 80005, 0, "ペコリーヌ", "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 0, 105801, "", 0, 378, 4, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, 80005, 0, "キャル", "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 0, 106001, "", 0, 379, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, 80005, 0, "キャル", "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 0, 106001, "", 0, 380, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, 80005, 0, "シェフィ", "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 0, 106401, "", 0, 381, 4, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, 80005, 0, "ペコリーヌ", "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 0, 105801, "", 0, 382, 4, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, 80005, 0, "コッコロ", "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 0, 105901, "", 0, 383, 4, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (16, 80005, 0, "キャル", "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 0, 106001, "", 0, 384, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, 80005, 0, "シェフィ", "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 0, 106401, "", 0, 385, 4, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, 80005, 0, "ペコリーヌ", "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 0, 105801, "", 0, 386, 5, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, 80005, 0, "ペコリーヌ", "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 0, 105801, "", 0, 387, 5, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, 80005, 0, "ペコリーヌ", "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 0, 105801, "", 0, 388, 5, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (17, 80005, 0, "キャル", "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 0, 106001, "", 0, 389, 5, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (18, 80005, 0, "キャル", "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 0, 106001, "", 0, 390, 5, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, 80005, 0, "シェフィ", "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 0, 106401, "", 0, 391, 5, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, 80005, 0, "コッコロ", "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 0, 105901, "", 0, 392, 5, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (16, 80005, 0, "ペコリーヌ", "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 0, 105801, "", 0, 393, 5, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (19, 80005, 0, "キャル", "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 0, 106001, "", 0, 394, 5, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (17, 80005, 0, "ペコリーヌ", "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 0, 105801, "", 0, 395, 5, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (18, 80005, 0, "ペコリーヌ", "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 0, 105801, "", 0, 396, 5, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (19, 80005, 0, "ペコリーヌ", "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 0, 105801, "", 0, 397, 5, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, 80005, 0, "カリン", "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 0, 190801, "", 0, 398, 6, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, 80005, 0, "カリン", "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 0, 190801, "", 0, 399, 6, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (20, 80005, 0, "キャル", "…えっ！？", 0, 106001, "", 0, 400, 6, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (20, 80005, 0, "ペコリーヌ", "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 0, 105801, "", 0, 401, 6, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, 80005, 0, "シェフィ", "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 0, 106401, "", 0, 402, 6, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, 80005, 0, "コッコロ", "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 0, 105901, "", 0, 403, 6, 4);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, 80005, 0, "シェフィ", "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 0, 106401, "", 0, 404, 6, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (21, 80005, 0, "キャル", "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 0, 106001, "", 0, 405, 6, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (21, 80005, 0, "ペコリーヌ", "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 0, 105801, "", 0, 406, 6, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (22, 80005, 0, "キャル", "ぶっ殺すぞ！？", 0, 106001, "", 0, 407, 6, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, 80005, 0, "カリン", "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 0, 190801, "", 0, 408, 6, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, 80005, 0, "コッコロ", "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 0, 105901, "", 0, 409, 7, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (23, 80005, 0, "キャル", "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 0, 106001, "", 0, 410, 7, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (16, 80005, 0, "シェフィ", "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 0, 106401, "", 0, 411, 7, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (22, 80005, 0, "ペコリーヌ", "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 0, 105801, "", 0, 412, 7, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (24, 80005, 0, "キャル", "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 0, 106001, "", 0, 413, 7, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (17, 80005, 0, "シェフィ", "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 0, 106401, "", 0, 414, 7, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (16, 80005, 0, "コッコロ", "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 0, 105901, "", 0, 415, 7, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (18, 80005, 0, "シェフィ", "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 0, 106401, "", 0, 416, 7, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (17, 80005, 0, "コッコロ", "もちろんでございます\n仲良くお勉強いたしましょう", 0, 105901, "", 0, 417, 7, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (25, 80005, 0, "キャル", "しれっと教育ママが\n生まれてる…？", 0, 106001, "", 0, 418, 7, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (23, 80005, 0, "ペコリーヌ", "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 0, 105801, "", 0, 419, 7, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (26, 80005, 0, "キャル", "え～～～～！？", 0, 106001, "", 0, 420, 7, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (27, 80005, 0, "キャル", "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 0, 106001, "", 0, 421, 8, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (19, 80005, 0, "シェフィ", "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 0, 106401, "", 0, 422, 8, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (18, 80005, 0, "コッコロ", "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 0, 105901, "", 0, 423, 8, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (24, 80005, 0, "ペコリーヌ", "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 0, 105801, "", 0, 424, 8, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (20, 80005, 0, "シェフィ", "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 0, 106401, "", 0, 425, 8, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (28, 80005, 0, "キャル", "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 0, 106001, "", 0, 426, 8, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (19, 80005, 0, "コッコロ", "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 0, 105901, "", 0, 427, 8, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (21, 80005, 0, "シェフィ", "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 0, 106401, "", 0, 428, 8, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (29, 80005, 0, "キャル", "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 0, 106001, "", 0, 429, 8, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (30, 80005, 0, "キャル", "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 0, 106001, "", 0, 430, 8, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (25, 80005, 0, "ペコリーヌ", "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 0, 105801, "", 0, 431, 8, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (31, 80005, 0, "キャル", "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 0, 106001, "", 0, 432, 8, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (22, 80005, 0, "シェフィ", "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 0, 106401, "", 0, 433, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (23, 80005, 0, "シェフィ", "…えっ？\n生放送の意気込み！？\n突然なに！？", 0, 106401, "", 0, 434, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (24, 80005, 0, "シェフィ", "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 0, 106401, "", 0, 435, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (25, 80005, 0, "シェフィ", "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 0, 106401, "", 0, 436, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (26, 80005, 0, "シェフィ", "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 0, 106401, "", 0, 437, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (27, 80005, 0, "シェフィ", "それから、それから…！\nぅ、ぅぅっ…！", 0, 106401, "", 0, 438, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (28, 80005, 0, "シェフィ", "―びえぇぇ～んっ！！！", 0, 106401, "", 0, 439, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (20, 80005, 0, "コッコロ", "どうされましたか、シェフィさま", 0, 105901, "", 0, 440, 9, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (29, 80005, 0, "シェフィ", "ううっ…ひっく…\nママッ…！", 0, 106401, "", 0, 441, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (21, 80005, 0, "コッコロ", "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 0, 105901, "", 0, 442, 9, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (22, 80005, 0, "コッコロ", "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 0, 105901, "", 0, 443, 9, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (30, 80005, 0, "シェフィ", "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 0, 106401, "", 0, 444, 9, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (23, 80005, 0, "コッコロ", "主さま\n3.5周年まであと５日\nでございます", 0, 105901, "", 0, 445, 10, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (24, 80005, 0, "コッコロ", "ですがその前に\n生放送がありますね", 0, 105901, "", 0, 446, 10, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (25, 80005, 0, "コッコロ", "…生放送に向けた\n意気込みでございますか？", 0, 105901, "", 0, 447, 10, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (26, 80005, 0, "コッコロ", "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 0, 105901, "", 0, 448, 10, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (27, 80005, 0, "コッコロ", "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 0, 105901, "", 0, 449, 10, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (28, 80005, 0, "コッコロ", "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 0, 105901, "", 0, 450, 10, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (29, 80005, 0, "コッコロ", "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 0, 105901, "", 0, 451, 10, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (30, 80005, 0, "コッコロ", "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 0, 105901, "", 0, 452, 10, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (31, 80005, 0, "コッコロ", "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 0, 105901, "", 0, 453, 10, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (26, 80005, 0, "ペコリーヌ", "3.5周年まであと４日！\nやばいですね☆", 0, 105801, "", 0, 454, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (32, 80005, 0, "キャル", "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 0, 106001, "", 0, 455, 11, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (27, 80005, 0, "ペコリーヌ", "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 0, 105801, "", 0, 456, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (28, 80005, 0, "ペコリーヌ", "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 0, 105801, "", 0, 457, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (29, 80005, 0, "ペコリーヌ", "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 0, 105801, "", 0, 458, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (33, 80005, 0, "キャル", "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 0, 106001, "", 0, 459, 11, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (30, 80005, 0, "ペコリーヌ", "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 0, 105801, "", 0, 460, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (31, 80005, 0, "ペコリーヌ", "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 0, 105801, "", 0, 461, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (32, 80005, 0, "ペコリーヌ", "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 0, 105801, "", 0, 462, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (34, 80005, 0, "キャル", "だからあたしはやるなんて一言も…", 0, 106001, "", 0, 463, 11, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (33, 80005, 0, "ペコリーヌ", "オイッスー☆", 0, 105801, "", 0, 464, 11, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (35, 80005, 0, "キャル", "聞きなさいっての！！", 0, 106001, "", 0, 465, 11, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (31, 80005, 0, "シェフィ", "3.5周年まであと３日…\nそして生放送は、明日…", 0, 106401, "", 0, 466, 12, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (32, 80005, 0, "シェフィ", "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 0, 106401, "", 0, 467, 12, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (33, 80005, 0, "シェフィ", "おいっす！\n…こうじゃなかったわね\nええと確か…", 0, 106401, "", 0, 468, 12, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (34, 80005, 0, "シェフィ", "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 0, 106401, "", 0, 469, 12, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (35, 80005, 0, "シェフィ", "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 0, 106401, "", 0, 470, 12, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (34, 80005, 0, "ペコリーヌ", "やってますねシェフィちゃん！", 0, 105801, "", 0, 471, 12, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (36, 80005, 0, "キャル", "なによ、考えることは\nみんな同じってこと？", 0, 106001, "", 0, 472, 12, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (32, 80005, 0, "コッコロ", "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 0, 105901, "", 0, 473, 12, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (36, 80005, 0, "シェフィ", "みんな…もちろんよ！", 0, 106401, "", 0, 474, 12, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (35, 80005, 0, "ペコリーヌ", "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 0, 105801, "", 0, 475, 12, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, 80005, 0, "カリン", "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 0, 190801, "", 0, 476, 13, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, 80005, 0, "カリン", "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 0, 190801, "", 0, 477, 13, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (36, 80005, 0, "ペコリーヌ", "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 0, 105801, "", 0, 478, 13, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, 80005, 0, "カリン", "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 0, 190801, "", 0, 479, 13, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (33, 80005, 0, "コッコロ", "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 0, 105901, "", 0, 480, 13, 4);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, 80005, 0, "カリン", "さすが【美食殿】のママですね！\nそしてキャルさんは…", 0, 190801, "", 0, 481, 13, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (37, 80005, 0, "キャル", "大丈夫…大丈夫…\nあたしは大丈夫…", 0, 106001, "", 0, 482, 13, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, 80005, 0, "カリン", "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 0, 190801, "", 0, 483, 13, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (37, 80005, 0, "シェフィ", "あうー？", 0, 106401, "", 0, 484, 13, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (37, 80005, 1, "みんな", "あ…", 0, 105801, "105901,34,106001,38,190801,12", 0, 485, 13, 4);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (39, 80005, 0, "キャル", "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 0, 106001, "", 0, 486, 13, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (35, 80005, 0, "コッコロ", "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 0, 105901, "", 0, 487, 13, 4);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (38, 80005, 0, "ペコリーヌ", "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 0, 105801, "", 0, 488, 13, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, 80005, 0, "カリン", "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 0, 190801, "", 0, 489, 13, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (38, 80005, 0, "シェフィ", "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 0, 106401, "", 0, 490, 14, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (39, 80005, 0, "ペコリーヌ", "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 0, 105801, "", 0, 491, 14, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (40, 80005, 0, "キャル", "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 0, 106001, "", 0, 492, 14, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (36, 80005, 0, "コッコロ", "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 0, 105901, "", 0, 493, 14, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (39, 80005, 0, "シェフィ", "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 0, 106401, "", 0, 494, 14, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (40, 80005, 0, "ペコリーヌ", "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 0, 105801, "", 0, 495, 14, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (37, 80005, 0, "コッコロ", "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 0, 105901, "", 0, 496, 14, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (41, 80005, 0, "キャル", "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 0, 106001, "", 0, 497, 14, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (40, 80005, 0, "シェフィ", "へ、へぇ…", 0, 106401, "", 0, 498, 14, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (41, 80005, 0, "ペコリーヌ", "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 0, 105801, "", 0, 499, 14, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (41, 80005, 0, "シェフィ", "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 0, 106401, "", 0, 500, 14, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (42, 80005, 0, "シェフィ", "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 0, 106401, "", 0, 501, 14, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (42, 80005, 0, "ペコリーヌ", "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 0, 105801, "", 0, 502, 15, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (42, 80005, 0, "キャル", "祝！", 0, 106001, "", 0, 503, 15, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (38, 80005, 0, "コッコロ", "3.5周年！", 0, 105901, "", 0, 504, 15, 4);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (43, 80005, 0, "シェフィ", "おめでとうございます！", 0, 106401, "", 0, 505, 15, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, 80005, 0, "カリン", "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 0, 190801, "", 0, 506, 15, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, 80005, 0, "カリン", "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 0, 190801, "", 0, 507, 15, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (43, 80005, 0, "ペコリーヌ", "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 0, 105801, "", 0, 508, 15, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (44, 80005, 0, "ペコリーヌ", "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 0, 105801, "", 0, 509, 15, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (43, 80005, 0, "キャル", "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 0, 106001, "", 0, 510, 15, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (44, 80005, 0, "キャル", "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 0, 106001, "", 0, 511, 15, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (44, 80005, 0, "シェフィ", "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 0, 106401, "", 0, 512, 15, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (45, 80005, 0, "シェフィ", "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 0, 106401, "", 0, 513, 15, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (39, 80005, 0, "コッコロ", "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 0, 105901, "", 0, 514, 15, 4);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (40, 80005, 0, "コッコロ", "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 0, 105901, "", 0, 515, 15, 4);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (41, 80005, 0, "コッコロ", "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 0, 105901, "", 0, 516, 15, 4);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (45, 80005, 0, "ペコリーヌ", "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 0, 105801, "", 0, 517, 15, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (46, 80005, 1, "みんな", "これからも\nよろしくおねがいします！", 0, 105801, "105901,42,106001,45,106401,46,190801,16", 0, 518, 15, 4);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 60003, 0, "カリン", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 190804, "", 0, 519, 0, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 1, 0, "", 1, 520, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, 0, "", 1, 521, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 1, 0, "", 1, 522, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 1, 0, "", 1, 523, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2, 0, "", 1, 524, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 1, 0, "", 2, 525, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 1, 0, "", 2, 526, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 1, 0, "", 2, 527, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 1, 0, "", 2, 528, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, 0, "", 2, 529, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 1, 0, "", 3, 530, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 1, 0, "", 3, 531, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 1, 0, "", 3, 532, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 1, 0, "", 3, 533, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 1, 0, "", 3, 534, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 1, 0, "", 3, 535, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 2, 0, "", 3, 536, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 1, 0, "", 4, 537, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 1, 0, "", 4, 538, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 1, 0, "", 4, 539, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 1, 0, "", 4, 540, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 1, 0, "", 4, 541, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 1, 0, "", 4, 542, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60003, 0, "", "今日の運勢は小吉！　無理は禁物、お家で静かにしていましょう　プロぼっちの私が、お家での過ごし方……教えてあげましょうか？", 2, 0, "", 4, 543, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 60003, 0, "カリン", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 190804, "", 0, 544, 0, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, 60003, 0, "カリン", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, 190804, "", 0, 545, 7, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 60004, 0, "カリン", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 190804, "", 0, 546, 0, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, 0, "", 1, 547, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 1, 0, "", 1, 548, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は姫吉！　宴でも開きたくなるほどの絶対幸運！\nイメチェンでもしてみるのはどうだ？　ぴょんぴょん、なんてな♪", 1, 0, "", 1, 549, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は姫吉！　ずっと祈り続けていた願いが叶うかも！\nきっとあんたならたどり着けるわ、ハッピーエンドのその先に", 1, 0, "", 1, 550, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 1, 0, "", 1, 551, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 1, 0, "", 2, 552, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 2, 0, "", 2, 553, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は大吉！　ラッキーワードは「ぴょんぴょん♪」\nおっきな声で一緒に言ってみよ～♪　うさぎさんぴょんぴょ～ん♪", 1, 0, "", 2, 554, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は大吉！　あなたの趣味がもっと広がるかも！\nかんわゆ～～～いショタと～騎士きゅんもゲット～んふふ～♪", 1, 0, "", 2, 555, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 1, 0, "", 2, 556, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 1, 0, "", 3, 557, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 2, 0, "", 3, 558, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 1, 0, "", 3, 559, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 1, 0, "", 3, 560, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は中吉！　健康に気を遣って気持ちのいい一年を！\n体に不調があるときは遠慮なく言いなさい、隅々まで調べてあげる", 1, 0, "", 3, 561, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は中吉！　歌を口ずさみ、幸運を呼び込もう！\n幸運になれるかは分からないけど……一緒に、歌いましょ？", 1, 0, "", 3, 562, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は中吉！　誰かに尽くすことで掴める幸せもあるかも？\n人事を尽くして天命を待つ！　さ、年始もバリバリ働きますわよ♪", 1, 0, "", 3, 563, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 1, 0, "", 4, 564, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は小吉！　無理は禁物、お家で静かにしていましょう　プロぼっちの私が、お家での過ごし方……教えてあげましょうか？", 1, 0, "", 4, 565, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 1, 0, "", 4, 566, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 2, 0, "", 4, 567, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 1, 0, "", 4, 568, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 1, 0, "", 4, 569, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60004, 0, "", "今日の運勢は小吉！　小さな勇気で踏み出す一歩が大事！\n遠くから見てるだけじゃダメ。今日は、少しだけ近づいてみます！", 2, 0, "", 4, 570, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 60004, 0, "カリン", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 190804, "", 0, 571, 0, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, 60004, 0, "カリン", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, 190804, "", 0, 572, 7, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 60005, 0, "カリン", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 190804, "", 0, 573, 0, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, 0, "", 1, 574, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は姫吉！　ずっと祈り続けていた願いが叶うかも！\nきっとあんたならたどり着けるわ、ハッピーエンドのその先に", 1, 0, "", 1, 575, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は姫吉！　道を歩けば幸運に当たる、最高の吉日！　　さすがは兄様。尽善尽美、金甌無欠の強運をお持ちですね。", 2, 0, "", 1, 576, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は姫吉！　旅立ち、どこへ行くもよし！　　　　　　　新年の門出も、お兄さんと一緒です♪　冒険にしゅっぱーつ♪", 2, 0, "", 1, 577, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は姫吉！　一日三食食べれば健康運アップ！　　　　　おせち。おぞうに。もっと、たべよ？　お兄。", 2, 0, "", 1, 578, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は大吉！　あなたの趣味がもっと広がるかも！\nかんわゆ～～～いショタと～騎士きゅんもゲット～んふふ～♪", 1, 0, "", 2, 579, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 1, 0, "", 2, 580, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は大吉！　日々の努力が実り、何事も良い方向へ！　　そんな弟くんには、お姉ちゃんのよしよしぎゅ～っをプレゼント♪", 1, 0, "", 2, 581, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は大吉！　お出かけするといいことあるかも？　　　　また一緒に、お忍びデートしてくださいね……騎士♪", 2, 0, "", 2, 582, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は大吉！　転居するならあたたかい場所が吉！　　　　煉獄の世なれど、住めば都と申しんす。ゆるりときなんせ……♪", 2, 0, "", 2, 583, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 1, 0, "", 3, 584, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は中吉！　誰かに尽くすことで掴める幸せもあるかも？\n人事を尽くして天命を待つ！　さ、年始もバリバリ働きますわよ♪", 1, 0, "", 3, 585, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は中吉！　歌を口ずさみ、幸運を呼び込もう！\n幸運になれるかは分からないけど……一緒に、歌いましょ？", 1, 0, "", 3, 586, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は中吉！　健康に気を遣って気持ちのいい一年を！\n体に不調があるときは遠慮なく言いなさい、隅々まで調べてあげる", 1, 0, "", 3, 587, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 1, 0, "", 3, 588, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は中吉！　争いごとは勝つが油断は大敵！　　　　　　ま、このあたしと一緒なら、向かうところ敵はねーですよっ！", 2, 0, "", 3, 589, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は中吉！　ラッキーアイテムは「光るもの」！　　　　ハツネちゃんの「きらーんっ☆」な魔法、見せちゃおうかなっ？", 2, 0, "", 3, 590, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は小吉！　のんびり穏やかな一日となるでしょう！　　あなた様を邪魔するものは全てエリコが排除しますわ、クスクス♪", 1, 0, "", 4, 591, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は小吉！　小さな勇気で踏み出す一歩が大事！\n遠くから見てるだけじゃダメ。今日は、少しだけ近づいてみます！", 1, 0, "", 4, 592, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 1, 0, "", 4, 593, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 1, 0, "", 4, 594, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 1, 0, "", 4, 595, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は小吉！　空を眺めると気持ちが晴れやかに！　　　　眺めるだけじゃなくて、ひとっ飛びしちゃいましょうかっ♪", 2, 0, "", 4, 596, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60005, 0, "", "今日の運勢は小吉！　掃除をすると運勢が開けそう！　　　　　　「わ、めんど」「ヴルムっ！　新年早々サボっちゃダメなんだからね！」", 2, 0, "", 4, 597, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 60005, 0, "カリン", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 190804, "", 0, 598, 0, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, 60005, 0, "カリン", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, 190804, "", 0, 599, 7, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 60006, 0, "カリン", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 190804, "", 0, 600, 0, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60006, 0, "", "今日の運勢は姫吉！　勇気を持って、新しいことに挑戦しよう！\n幸先がいいねえ少年！　今年もいい一年になるよう祈ってるよ。", 2, 0, "", 1, 601, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60006, 0, "", "今日の運勢は姫吉！　どんなピンチも簡単に乗り越えられそう！\nよい結果が出たようで何よりです。さて、待人の方は……ふふ。", 2, 0, "", 1, 602, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60006, 0, "", "今日の運勢は姫吉！　あの人と仲直り……できちゃうかも！？\nはあ……この私があなたの運勢に興味を抱くわけないでしょう？", 2, 0, "", 1, 603, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60006, 0, "", "今日の運勢は大吉！　身近な友達との絆が深まる予感……？\n騎士様は、どなたと友誼を結ぶのでしょう？　気になります……", 1, 0, "", 2, 604, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60006, 0, "", "今日の運勢は大吉！　ラッキーアイテムは「蛇の抜け殻」！\nこのアタシにお目にかかれるなんて……アンタ、幸せものね♪", 2, 0, "", 2, 605, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60006, 0, "", "今日の運勢は中吉！　気になるあの人に会えちゃうかも！？\n『初夢を正夢にする枕』であなたに会え……な、なんでもない！", 2, 0, "", 3, 606, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60006, 0, "", "今日の運勢は中吉！　子供に戻って、一日中遊びつくそう！\nお年玉でけん玉ゲット！　おじちゃん、もしかめ一万回やって！", 2, 0, "", 3, 607, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60006, 0, "", "今日の運勢は中吉！　今日はおうちで、ゆーっくりくつろごう。\nお雑煮よし。みかんよし。さ、こたつで寝正月だ。君も入る？", 1, 0, "", 3, 608, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60006, 0, "", "今日の運勢は小吉！　突然のドッキリに注意！\nおや、後ろに髪の長い女の霊が──フフ、冗談です。私ですよ。", 2, 0, "", 4, 609, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 60006, 0, "", "今日の運勢は小吉。慌てなくても、幸運はきっとやってくる。\n運は自分で掴むもの──媛が言ってました。でも、どうやって？", 2, 0, "", 4, 610, 0, 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 60006, 0, "カリン", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 190804, "", 0, 611, 0, 3);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, 60006, 0, "カリン", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, 190804, "", 0, 612, 5, 3);
